"use client"

import React, { useState, useEffect, useRef } from "react"
import { Button } from "@/components/ui/button"
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from "@/components/ui/select"
import { AlertCircle, Upload, X, Map, Plus } from "lucide-react"
import { AllocationStats } from "@/components/allocation-stats"
import type { AllocationResponse } from "@/types/allocation"
import { API_URL } from "./layout"

const BRASAO_B64 = "data:image/jpeg;base64,"

interface Local { id: string; nome: string; capacidade?: number }

export default function Home() {
  const [arquivo, setArquivo] = useState<File | null>(null)
  const [localId, setLocalId] = useState("")
  const [loading, setLoading] = useState(false)
  const [error, setError] = useState<string | null>(null)
  const [result, setResult] = useState<AllocationResponse | null>(null)
  const [locais, setLocais] = useState<Local[]>([])
  const [loadingLocais, setLoadingLocais] = useState(true)
  const fileRef = useRef<HTMLInputElement>(null)
  const dropRef = useRef<HTMLDivElement>(null)

  useEffect(() => {
    fetch(`${API_URL}/listar_locais/`)
      .then(r => r.json()).then(setLocais).catch(console.error)
      .finally(() => setLoadingLocais(false))
  }, [])

  const handleFile = (file: File | null) => {
    if (!file) { setArquivo(null); return }
    const ok = ["text/csv","text/plain","application/vnd.openxmlformats-officedocument.spreadsheetml.sheet","application/vnd.ms-excel"]
    if (!ok.includes(file.type)) { setError("Arquivo invlido. Use CSV ou Excel."); setTimeout(()=>setError(null),4000); return }
    if (file.size > 5*1024*1024) { setError("Arquivo deve ter menos de 5MB."); setTimeout(()=>setError(null),4000); return }
    setArquivo(file); setError(null)
  }

  const onDragOver = (e: React.DragEvent) => {
    e.preventDefault()
    dropRef.current?.classList.add("border-rose-400","bg-rose-50")
  }
  const onDragLeave = (e: React.DragEvent) => {
    e.preventDefault()
    dropRef.current?.classList.remove("border-rose-400","bg-rose-50")
  }
  const onDrop = (e: React.DragEvent) => {
    e.preventDefault()
    dropRef.current?.classList.remove("border-rose-400","bg-rose-50")
    if (e.dataTransfer.files[0]) handleFile(e.dataTransfer.files[0])
  }

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault()
    if (!arquivo || !localId) { setError("Selecione arquivo e local."); return }
    setLoading(true); setError(null); setResult(null)
    try {
      const fd = new FormData()
      fd.append("arquivo", arquivo)
      fd.append("local_id", localId)
      const r = await fetch(`${API_URL}/api/planilha/processar`, { method:"POST", body:fd })
      const data = await r.json()
      if (!r.ok) throw new Error(data.error || "Erro ao processar")
      setResult(data)
    } catch(err) {
      setError(err instanceof Error ? err.message : "Erro desconhecido")
    } finally { setLoading(false) }
  }

  return (
    <main className="min-h-screen" style={{backgroundImage: "linear-gradient(135deg, #fff0f6 0%, #fce7f3 40%, #fdf2f8 100%)"}}> 
      {/*  Header  */}
      <div style={{background: "linear-gradient(135deg, #be185d 0%, #db2777 50%, #ec4899 100%)"}}>
        <div className="max-w-5xl mx-auto px-6 py-8 flex items-center gap-6">
          <img 
            src={BRASAO_B64} alt="Braso UFC" 
            className="h-20 w-20 object-contain flex-shrink-0"
            style={{filter: "drop-shadow(0 4px 12px rgba(0,0,0,0.35))", borderRadius:"50%", background:"rgba(255,255,255,0.15)", padding:"6px"}}
          />
          <div className="text-white">
            <p className="text-pink-200 text-xs font-semibold tracking-widest uppercase mb-1">Universidade Federal do Cear</p>
            <h1 className="text-2xl font-bold leading-tight">Sistema de Alocao de Assentos</h1>
            <p className="text-pink-200 text-sm mt-1">Gerencie a distribuio de assentos para formaturas</p>
          </div>
          <div className="ml-auto">
            <Button onClick={()=>window.location.href="/criar-local"} 
              className="bg-white/20 hover:bg-white/30 text-white border border-white/30 backdrop-blur-sm">
              <Plus className="h-4 w-4 mr-2"/> Novo Local
            </Button>
          </div>
        </div>
      </div>

      <div className="max-w-5xl mx-auto px-6 py-8 space-y-8">
        {/*  Card Form  */}
        <div style={{background:"rgba(255,255,255,0.8)", backdropFilter:"blur(12px)", border:"1px solid #fbcfe8", borderRadius:"16px", boxShadow:"0 4px 24px rgba(219,39,119,0.1)"}}>
          <div className="px-8 py-5 border-b" style={{borderColor:"#fce7f3"}}>
            <h2 className="text-lg font-bold" style={{color:"#9d174d"}}>Processar Planilha</h2>
            <p className="text-sm mt-0.5" style={{color:"#be185d", opacity:0.7}}>Faa upload da planilha e selecione o local para gerar a alocao</p>
          </div>
          <div className="px-8 py-6">
            <form onSubmit={handleSubmit} className="space-y-6">
              {/* Upload */}
              <div className="space-y-2">
                <label className="text-sm font-semibold" style={{color:"#9d174d"}}>Arquivo da Planilha *</label>
                <div
                  ref={dropRef}
                  onDragOver={onDragOver} onDragLeave={onDragLeave} onDrop={onDrop}
                  onClick={()=>fileRef.current?.click()}
                  className="border-2 border-dashed rounded-xl p-8 cursor-pointer transition-all"
                  style={{borderColor:"#f9a8d4", textAlign:"center"}}
                >
                  <input ref={fileRef} type="file" accept=".csv,.xlsx,.xls" className="hidden"
                    onChange={e=>handleFile(e.target.files?.[0]||null)}/>
                  <div style={{display:"flex",flexDirection:"column",alignItems:"center",gap:"12px"}}>
                    <div style={{background:"#fce7f3",borderRadius:"50%",padding:"16px"}}>
                      <Upload style={{color:"#db2777",width:"24px",height:"24px"}}/>
                    </div>
                    <div>
                      <p className="font-semibold" style={{color:"#9d174d"}}>Arraste o arquivo aqui ou clique para selecionar</p>
                      <p className="text-sm mt-1" style={{color:"#f472b6"}}>CSV ou Excel  mximo 5MB</p>
                    </div>
                  </div>
                </div>
                {arquivo && (
                  <div className="flex items-center justify-between p-3 rounded-lg" style={{background:"#fdf2f8",border:"1px solid #fbcfe8"}}>
                    <div className="flex items-center gap-2">
                      <span style={{color:"#db2777"}}></span>
                      <div>
                        <p className="text-sm font-medium" style={{color:"#9d174d"}}>{}</p>
                        <p className="text-xs" style={{color:"#f472b6"}}>{(arquivo.size/1024).toFixed(1)} KB</p>
                      </div>
                    </div>
                    <button type="button" onClick={()=>setArquivo(null)} style={{color:"#f472b6",background:"none",border:"none",cursor:"pointer"}}>
                      <X style={{width:"16px",height:"16px"}}/>
                    </button>
                  </div>
                )}
              </div>

              {/* Local */}
              <div className="space-y-2">
                <label className="text-sm font-semibold" style={{color:"#9d174d"}}>Local *</label>
                <Select value={localId} onValueChange={setLocalId} disabled={loading||loadingLocais}>
                  <SelectTrigger style={{borderColor:"#f9a8d4"}}>
                    <SelectValue placeholder={loadingLocais ? "Carregando..." : "Selecione um local"}/>
                  </SelectTrigger>
                  <SelectContent>
                    {locais.map(l=>(
                      <SelectItem key={l.id} value={l.id}>
                        {l.nome}{l.capacidade && ` (${l.capacidade} lugares)`}
                      </SelectItem>
                    ))}
                  </SelectContent>
                </Select>
              </div>

              {error && (
                <div className="flex items-center gap-2 p-3 rounded-lg" style={{background:"#fff1f2",border:"1px solid #fecdd3"}}>
                  <AlertCircle style={{color:"#e11d48",width:"16px",height:"16px",flexShrink:0}}/>
                  <p className="text-sm" style={{color:"#be123c"}}>{}</p>
                </div>
              )}

              <button
                type="submit"
                disabled={loading||!localId||!arquivo}
                className="w-full py-3 rounded-xl text-white font-semibold text-base transition-all"
                style={{
                  background: (loading||!localId||!arquivo) ? "#f9a8d4" : "linear-gradient(135deg,#db2777,#ec4899)",
                  cursor: (loading||!localId||!arquivo) ? "not-allowed" : "pointer",
                  boxShadow: (loading||!localId||!arquivo) ? "none" : "0 4px 16px rgba(219,39,119,0.3)"
                }}
              >
                {loading ? " Processando..." : "Gerar Alocao"}
              </button>
            </form>
          </div>
        </div>

        {/*  Resultados  */}
        {result && (
          <div className="space-y-6">
            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
              {[
                {label:"Formatura",icon:"",val:result.formatura.nome,sub:new Date(result.formatura.data).toLocaleDateString("pt-BR")},
                {label:"Local",icon:"",val:result.formatura.local,sub:`Taxa: ${result.alocacao?.taxa_ocupacao||"N/A"}`},
                {label:"Formandos",icon:"",val:String(result.formatura.total_formandos),sub:`${result.alocacao?.total_alocado||0} alocados`},
              ].map((c)=>(
                <div key={c.label} style={{background:"rgba(255,255,255,0.8)",border:"1px solid #fbcfe8",borderRadius:"12px",padding:"20px",backdropFilter:"blur(8px)"}}>
                  <p className="text-sm font-medium" style={{color:"#be185d"}}>{}</p>
                  <p className="text-xl font-bold mt-1" style={{color:"#9d174d"}}>{}</p>
                  <p className="text-xs mt-1" style={{color:"#f472b6"}}>{}</p>
                </div>
              ))}
            </div>

            {result.alocacao?.detalhes && <AllocationStats details={result.alocacao.detalhes}/>}

            <div style={{background:"rgba(255,255,255,0.8)",border:"1px solid #fbcfe8",borderRadius:"16px",padding:"24px",backdropFilter:"blur(8px)"}}>
              <h3 className="font-bold mb-1" style={{color:"#9d174d"}}>Mapa de Assentos</h3>
              <p className="text-sm mb-4" style={{color:"#be185d",opacity:0.7}}>O boto de exportar PDF fica disponvel dentro do mapa interativo</p>
              <button
                onClick={()=>result.formatura?.id && window.open(`/mapa/${result.formatura.id}`,'_blank')}
                className="w-full py-3 rounded-xl text-white font-semibold flex items-center justify-center gap-2"
                style={{background:"linear-gradient(135deg,#db2777,#ec4899)",boxShadow:"0 4px 16px rgba(219,39,119,0.3)",cursor:"pointer",border:"none"}}
              >
                <Map style={{width:"20px",height:"20px"}}/>
                Ver Mapa Interativo
              </button>
            </div>
          </div>
        )}
      </div>
    </main>
  )
}